import React from "react";
import NavBar from "../src/components/NavBar/NavBar";
import Navigation from "../src/components/Navigation/Navigation";
import Footer from "../src/components/Footer/Footer";

function App() {
  return (
    <div className="App">
      <NavBar />
      <Navigation />
      <Footer></Footer>
    </div>
  );
}
export default App;
